import React from "react";

import classes from "./Button.module.css";

const Button = (props) => {
  return (
    <button
      id={props.id}
      type={props.type || "button"}
      className={`${classes.btn-grad} ${props.className}`}
      onClick={props.onClick}
      disabled={props.disabled}
    >
      {props.children}
    </button>
  );
};

export default Button;
